import About from "./about";
import Projects from './projects';
import { personalProjects, academicProjects } from "../data/projects";
import { positions } from "../data/experience";

function PersonalProjects() {
    return (
        <section id='personalprojects'>
            <Projects projects={personalProjects} />
        </section>
    );
}

function AcademicProjects() {
    return (
        <section id='academicprojects'>
            <Projects projects={academicProjects} />
        </section>
    );
}

function Experience() {
    return (
        <section id='experience'>
            <Projects projects={positions} />
        </section>
    );
}

export default function Main() {
    return (
        <main>
            <About />
            <Experience />
            <PersonalProjects />
            <AcademicProjects />
        </main>
    );
}
